import React, { Component } from 'react';
import { Media } from 'reactstrap';


class Modules extends Component{

  constructor(props){
    super(props);
    this.state={
      datas: [
        {
          id: 0,
          name:'How To Improve Focus & Concentration: Learn To Focus Better',
          category: 'jumbotron',
          description:'Focus & Concentration Strategies For Personal Productivity: Brain Hacking Tips & A 21 Day Focus For Success Challenge '         },
        ],

    }
  }

 render(){
    const modules = this.state.datas.map((data) => {
      return (
        <div key={data.id} className="jumbotron">
        <Media tag="li">
        <Media left-middle>
          <Media object alt={data.name}  />
         </Media>
        </Media>
        <Media body className="row row-header" >
          <h3>{data.name}</h3>
          <p>{data.description}</p>
        </Media>
        </div>
      );
    });

	  return(
      <div className="container">
           <div className="row">

              <Media list>
               {modules}
               </Media>
               </div>

          </div>
    );
  }
}

export default Modules;
